import React from "react";
import Menu from "./menuApi";

const MenuCard = ({ menuData }) => {
  return (
    <section className="main-card--cointainer">
      <>
        {menuData.map((curElem) => {
          return (
            <>
              <div className="card-container">
                <div className="card">
                  <div className="card-body">
                    <span className="card-number card-circle subtle">1</span>
                    <span className="card-author subtle">Breakfast</span>
                    <span className="card-description subtle">
                      Maggi was the first to bring protein-rich legume meals to
                      the market, and followed up with a ready-made soup based
                      on legume meals in 1886. After that Julius Maggi
                      introduced bouillon concentrates, first in capsules, then
                      in cubes. In 1897, Julius Maggi founded the company Maggi
                      GmbH in Singen, Germany.
                    </span>
                    <div className="card-read">Read</div>
                  </div>
                  {/* <img src={image} alt="images" className="card-media" /> */}
                  <span className="card-tag subtle">Order now</span>
                </div>
              </div>
            </>
          );
        })}
      </>
    </section>
  );
};

export default MenuCard;
